Actionscript.script:
stop();
_root.AreaTextClipF("Inside the Castle:"+newline+"<i>Upper Hallway</i>", 55);
playedsound = false;
_root.warpframe = false;
_root.Starnamenum = 0;
onEnterFrame = function () {
	if (this.warp1.hitTest(_root.Course.Char.charClip.feet) && (_root.BowserKey2 == true || _root.CheatCastleUnlock == true)) {
		_root.Course.Char.attack = true;
		_root.Course.Char.xspeed = 0;
		_root.Course.Char.yspeed = 0;
		_root.Course.Char.attackFrame = "none";
		warp = true;
		warpnum = 1;
	}
	if (this.warp2.hitTest(_root.Course.Char.charClip.feet)) {
		_root.Course.Char.attack = true;
		_root.Course.Char.xspeed = 0;
		_root.Course.Char.yspeed = 0;
		_root.Course.Char.attackFrame = "none";
		warp = true;
		warpnum = 2;
	}
	if (this.warp3.hitTest(_root.Course.Char.charClip.feet)) {
		_root.Course.Char.attack = true;
		_root.Course.Char.xspeed = 0;
		_root.Course.Char.yspeed = 0;
		_root.Course.Char.attackFrame = "none";
		warp = true;
		warpnum = 3;
	}
	if (this.warp4.hitTest(_root.Course.Char.charClip.feet)) {
		_root.Course.Char.attack = true;
		_root.Course.Char.xspeed = 0;
		_root.Course.Char.yspeed = 0;
		_root.Course.Char.attackFrame = "none";
		warp = true;
		warpnum = 4;
	}
	if (warp == true && _root.warpframe == false) {
		if (warpnum == 1) {
			_root.attachMovie("lefttransition", "lefttransition"+_root.getNextHighestDepth(), _root.getNextHighestDepth(), {_x:_root.screensizeX/2, _y:_root.screensizeY/2});
		}
		if (warpnum == 2) {
			_root.attachMovie("downtransition", "downtransition"+_root.getNextHighestDepth(), _root.getNextHighestDepth(), {_x:_root.screensizeX/2, _y:_root.screensizeY/2});
		}
		if (warpnum == 3) {
			if (playedsound == false) {
				_root.PaintingSound();
			}
			playedsound = true;
			_root.attachMovie("lefttransition", "lefttransition"+_root.getNextHighestDepth(), _root.getNextHighestDepth(), {_x:_root.screensizeX/2, _y:_root.screensizeY/2});
		}
		if (warpnum == 4) {
			if (playedsound == false) {
				_root.PaintingSound();
			}
			playedsound = true;
			_root.attachMovie("downtransition", "downtransition"+_root.getNextHighestDepth(), _root.getNextHighestDepth(), {_x:_root.screensizeX/2, _y:_root.screensizeY/2});
		}
	}
	if (_root.warpframe == true) {
		if (warpnum == 1) {
			//_root.StopBGsong();
			//_root.Playinglevel = ""
			_root.changecourse("lefttransition2", "C-2", -150, 0, 270, -425);
		}
		if (warpnum == 2) {
			//_root.StopBGsong();
			//_root.Playinglevel = ""
			_root.changecourse("downtransition2", "C-9", 90, 0, -90, -390);
		}
		if (warpnum == 3) {
			_root.Fluddpow = "";
			_root.Restartcoins();
			_root.StopBGsong();
			//_root.Playinglevel = ""
			_root.changecourse("lefttransition2", "9-10", 0, -230, 0, -230, true);
		}
		if (warpnum == 4) {
			_root.Fluddpow = "";
			_root.Restartcoins();
			_root.StopBGsong();
			//_root.Playinglevel = ""
			_root.changecourse("downtransition2", "9-03-2", -270, -990, -270, -990, true);
		}
	}
};

onClipEvent (load) {
	doorplace = "C-12-1";
	//d13
	dooropenarray = 12;
	//Changed to Kamek Bttle
	locked = true;
	keytype = 1;
	unlockitem = "RedStar";
	if (_root.Star[51] == true || _root.CheatCastleUnlock == true) {
		removelock = true;
	}
	//  
	keytype = 12;
	//                                 
	doorlockfunction = function () {
		_root.Course.Char.attack = true;
		_root.Course.Char.attackFrame = "Sign";
		_root.Course.Char.xspeed = 0;
		//
		_root.PlayMessage("You need a special <b>Red Shine Sprite</b> to open this door!");
		_root.Mariosound = new Sound(this);
		_root.Mariosound.attachSound("BowserLaugh");
		_root.Mariosound.start(0, 1);
		_root.Mariosound.setVolume(_root.MarioVolume);
		count = 0;
		onEnterFrame = function () {
			X = _x+_parent._x;
			_root.Course.Char._x += (X-_root.Course.Char._x)/5;
			//
			_root.playpause = true;
			//
			count++;
			if (_root.KeyZ() && count>5) {
				_root.StopMessage();
				//
				count = 0;
				onEnterFrame = function () {
					count++;
					if (count>5) {
						_root.playpause = false;
						_root.Course.Char.attack = false;
						onEnterFrame = null;
						gotoAndStop(1);
					}
				};
			}
		};
	};
}
onClipEvent (enterFrame) {
	if (_root.Star[51] == true || _root.CheatCastleUnlock == true) {
		removelock = true;
	}
}

